  var node = selection.startNode;
  if(node){
	  if(selection.startRow.rowIndex == selection.endRow.rowIndex){
		  var s = node.nodeValue.substr(0,selection.endOffset);
		  return s.substr(selection.startOffset,selection.endOffset); 
	  }else{
		  return this.getRowsText(selection.startRow.rowIndex,selection.endRow.rowIndex + 1);
	  }
  }
  return "";
